import React, { useEffect } from "react";
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";
import curdApi from "../helper/curdApi";
import { notification } from "../helper/notifications";

export default function AddModal({ open, handleClose, id }) {
  const [city, setCity] = use
  useEffect(() => {
    curdApi
      .getId({ payload: {}, id: id })
      .then((content) => {
        setCity(content.data);
      })
      .catch((data) => {
        notification("error", "danger", data?.message || "SERVER ERROR");
      });
  }, []);
  const handleAdd = () => {};
  // console.log(id);
  return (
    <div>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle id="alert-dialog-title">
          {"آیا میخواهید این شهر را انتخاب کنید"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            {}
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            لغو
          </Button>
          <Button onClick={handleAdd} color="primary" autoFocus>
            بله
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
